INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'cours', 0, 1, 1, 'und', 0, 'Цей курс допоможе вам навчитися створювати веб сайти на основі системи керування контентом. Все, від скінування дизайну до підключення CMS. Цей курс дасть вам чудовий старт для фріланса або роботи в компанії.', '', 'filtered_html'),
('node', 'team', 0, 2, 2, 'und', 0, 'Працює з рядом технологій, включаючи Symfony, Drupal, jQuery, Compass CSS, HAML, etc. Майстерність Євгена стоїть за такими проектами як Belvilla, Yes or No, Jongenvrij webshop, USGA та багато інших. У GeekHub викладає Frontend + CMS.', '', 'filtered_html'),
('node', 'team', 0, 3, 3, 'und', 0, 'Тимофій працює одночасно над декількома проектами - presentain.com, vkorange.com, chedream.org, geekhub.ck.ua". У GeekHub викладає курс iOS.', '', 'filtered_html'),
('node', 'team', 0, 4, 4, 'und', 0, 'Займається розвитком компанії в цілому та розробкою окремих проектів. На рахунку Олега такі проекти як Ever.travel — сервіс планування подорожей. SeiCrm.com — CRM система страхування. та ряд інших цікавих проектів для різних компаній. ', '', 'filtered_html'),
('node', 'team', 0, 5, 5, 'und', 0, 'Cергій протягом 4х років займається розробкою Android додатків в компанії Master Of Code. У GeekHub Сергій викладає Java for Android.', '', 'filtered_html'),
('node', 'team', 0, 6, 6, 'und', 0, 'Нік займається розвитком бізнесу компанії Master of Code LLC та розвитком стартапу presentain.com . У складі Geekhub Нік викладає Project Management та працює над брендінгом та маркетингом проекту.', '', 'filtered_html'),
('node', 'team', 0, 7, 7, 'und', 0, 'Валентин займається питаннями технічного забезпечення Geekhub.', '', 'filtered_html'),
('node', 'team', 0, 8, 8, 'und', 0, 'Олег професiйно займаеться розробкою веб додаткiв на PHP з використанням сучасних фреймфоркiв. Адепт Symfony2 та MongoDB. Координатор та викладач напрямку Advanced PHP. Останній проект - Фітнес startup www.exercise.com', '', 'filtered_html'),
('node', 'team', 0, 9, 9, 'und', 0, 'Since gaining his CELTA teaching qualification, Tim has specialised in private English lessons, meeting a wide range of student needs. At Geekhub Tim leads the Technical English course.', '', 'filtered_html'),
('node', 'team', 0, 10, 10, 'und', 0, 'Юрій працює із командою розробників веб та кросс-платформових мобільних технологій. Його нещодавні проекти включають у себе stickyalbums.com, chewy.com. У GeekHub Юрій займається організацією та розвитком проекту.', '', 'filtered_html'),
('node', 'team', 0, 11, 11, 'und', 0, 'Активний учасник багатьох відкритих проектів, завжди вивчає щось нове зі світу JavaScript. У GeekHub викладає Javascript.', '', 'filtered_html'),
('node', 'team', 0, 12, 12, 'und', 0, 'Олена має значний досвід у сфері контролю якості та управління проектами. У GeekHub викладає Quality Assurance.', '', 'filtered_html'),
('node', 'team', 0, 13, 13, 'und', 0, 'Володимир є Java та Android розробником у SPD-Ukraine. Його основний проект -- nimblecommerce.com, що є яскравим прикладом реалізації eCommerce SaaS У GeekHub викладає Java for Web.', '', 'filtered_html'),
('node', 'team', 0, 14, 14, 'und', 0, 'Backend та frontend веб-розробник. Основні технології, з якими працює: Spring (MVC, Security), Hibernate, mySql, MongoDB, jQuery, Ext.js Хоббі включають сноуборд, музика, mobile development. У GeekHub Валерій викладає JavaScript.', '', 'filtered_html'),
('node', 'team', 0, 15, 15, 'und', 0, 'Богдан керує компанією SPD-Ukraine та займається її розвитком. Має більше ніж 10 років досвіду з Java. У складі GeekHub Богдан є викладачем та координатором групи Java for Web.', '', 'filtered_html'),
('node', 'team', 0, 16, 16, 'und', 0, 'Богдан один з головних розробників компанії TransferWise. Прихильник швидких, динамічних та надійних рішень у розробці програмного забезпечення. Викладатиме курс улюбленої мови програмування та фреймворку - Groovy & Grails.', '', 'filtered_html'),
('node', 'team', 0, 17, 17, 'und', 0, 'Він бачив багато і може з радістю цим поділитися. У GeekHub викладає iOS.', '', 'filtered_html'),
('node', 'team', 0, 18, 18, 'und', 0, 'Android розробник, активный учасник GDG Cherkasy. У GeekHub викладає Android. На рахунку Дмитра такі проекти як Heineken Nederland Magazine, LifeChurch Android app. У GeekHub викладає Java for Android.', '', 'filtered_html'),
('node', 'team', 0, 19, 19, 'und', 0, 'Сергій займається розробкою веб проектів, використовуючи такі технології як Symfony 1, 2, Zend framework, Drupal, mysql, JS. У GeekHub Сергій викладає Advanced CMS.', '', 'filtered_html'),
('node', 'team', 0, 20, 20, 'und', 0, 'Юра займається розробкою комерційних проектів на Java зі складною клієнт-серверною архітектурою. У GeekHub викладає Java for Web.', '', 'filtered_html'),
('node', 'team', 0, 21, 21, 'und', 0, 'Студент GeekHub у минулому, а зараз - backend девелопер в успішній продуктовій компанії США. Сергій полюбляє складні завдання та прості рішення. У GeekHub викладає Advanced PHP.', '', 'filtered_html'),
('node', 'team', 0, 22, 22, 'und', 0, 'Владислав займається розробкою веб проектів, використовуючи такі фреймворки як Symfony 2, Yii; CMS - Joomla, Wordpress, Magento. На GeekHub Владислав викладає курс Advanced CMS.', '', 'filtered_html'),
('node', 'team', 0, 23, 23, 'und', 0, 'Андрій - сертифікований Java 7 Programmer з великим досвідом реалізації back-end та front-end, у тому числі на проектах створення фінансових систем. У GeekHub викладає Java for Web.', '', 'filtered_html'),
('node', 'team', 0, 24, 24, 'und', 0, 'Молода і дуже талановита. Протягом всього кількох років змогла побудувати успішну кар’єру в ІТ. У GeekHub викладає Advanced PHP.', '', 'filtered_html'),
('node', 'team', 0, 25, 25, 'und', 0, 'Алекс (або ж Дікс, як його всі кличуть) займається Frontend, AngularJS, Sencha Touch та Wordpress розробкою в N3w Normal LLC вже протягом двох років. У GeekHub викладає Frontend + CMS.', '', 'filtered_html'),
('node', 'team', 0, 26, 26, 'und', 0, 'Дмитро займається розробкою веб проектів, використовуючи такі технології як Symfony (1, 2) , Zend Framework, Yii, nodeJs, mysql, mongoDB, JS, angular.js. У GeekHub Дмитро викладає Advanced PHP.', '', 'filtered_html'),
('node', 'team', 0, 27, 27, 'und', 0, 'Fred has been coding for over 10 years, his first mobile app was published before anyone knew what a smartphone was. Now he the techinal lead at eKreative where the focus is on web and mobile apps. Teaches Javascript at GeekHub.', '', 'filtered_html'),
('node', 'team', 0, 28, 28, 'und', 0, 'Випускниця GeekHub, зараз працює QA інженером у MasterOfCode. У GeekHub викладає Quality Assurance.', '', 'filtered_html'),
('node', 'team', 0, 29, 29, 'und', 0, 'Вадим розробник у компанії TransferWise. У попередньому працював розробником та консультантом у банках різних країн Європи та світу. У GeekHub викладає Groovy & Grails.', '', 'filtered_html'),
('node', 'team', 0, 30, 30, 'und', 0, 'Сергій один з перших розробників у компанії TransferWise. У GeekHub викладає Groovy & Grails.', '', 'filtered_html'),
('node', 'team', 0, 31, 31, 'und', 0, 'Дмитро вже багато років розробляє web проекти, має досвід з Yii\\Yii2, Symfony2, Spring 3. Є контриб''ютором Yii2 та полюблюяє використовувати нові технології. У GeekHub викладає Advanced PHP.', '', 'filtered_html'),
('node', 'team', 0, 32, 32, 'und', 0, 'Фрілансер. frontend/backend developer веб додатків. Улюблений PHP фреймворк - Yii. Прихильник масимальної автоматизації розробки. У GeekHub викладає Advanced PHP.', '', 'filtered_html'),
('node', 'team', 0, 33, 33, 'und', 0, 'Альона має науковий ступінь PhD та працює головним проектним менеджером у компанії Master of Code LLC. У Geekhub Альона викладає Project Management.', '', 'filtered_html'),
('node', 'team', 0, 34, 34, 'und', 0, 'Працює з рядом технологій, включаючи HTML5/CSS3, jQuery, SASS/SCSS/LESS, CoffeeScript, HAML, Twig, Require JS, Titanium SDK. Обожнює "чистий" код. У GeekHub викладає Frontend + CMS.', '', 'filtered_html'),
('node', 'team', 0, 35, 35, 'und', 0, 'Loves briniging the best in people, helping them realise their potential as professionals and humans. Has a beautiful wife and two amazing children. He is a lawyer by education, enterprenuer by calling and story-teller by hobby. У GeekHub викладає Business English.', '', 'filtered_html'),
('node', 'team', 0, 36, 36, 'und', 0, 'Богдан має великий досвід у дизайні. Його пристрасть – зручні, прості та зрозумілі речі. У GeekHub Богдан викладає Web & Mobile Design.', '', 'filtered_html'),
('node', 'team', 0, 37, 37, 'und', 0, 'У Pixel Grow Тетяна займається веб дизайном та дизайном мобільних додатків. Вона приділяє багато уваги невеликим але важливим деталям. Полюбляє лаконічний дизайн та котів :) У GeekHub викладає Web & Mobile Design.', '', 'filtered_html'),
('node', 'team', 0, 38, 38, 'und', 0, 'Вікторія має за плечима декілька випущених ігр у ролі від геймдизайнера до керівника проекту. Зараз у ENKI Games займається розвитком основного продукту компанії. У GeekHub викладає Game Development.', '', 'filtered_html'),
('node', 'team', 0, 39, 39, 'und', 0, 'Дизайнер в eKreative. У GeekHub викладає Web & Mobile Design.', '', 'filtered_html'),
('node', 'team', 0, 40, 40, 'und', 0, 'Зрозумівши, що не може жити без творчості, Ольга змінила фармацію на графічний дизайн. Ще ніразу про це не пошкодувала. Зараз займається розробкою дизайну для мобільних додатків та сайтів. У GeekHub викладає Web & Mobile Design.', '', 'filtered_html'),
('node', 'team', 0, 41, 41, 'und', 0, 'Працює керівником проектів в компанії Master of Code та фін.консультантом стартапу presentain.com. Учасник адміністративної команди GeekHub', '', 'filtered_html'),
('node', 'team', 0, 42, 42, 'und', 0, 'Працює керівником проектів в компанії Master of Code. Учасник адміністративної команди GeekHub', '', 'filtered_html'),
('node', 'team', 0, 43, 43, 'und', 0, 'Закінчивши третій сезон GeekHub, вирішила, що хоче робити світ кращим разом з учасниками цієї IT-community:) Працює в адміністративній команді. ', '', 'filtered_html'),
('node', 'team', 0, 44, 44, 'und', 0, 'Закінчивши третій сезон почала працювати в стартапі Klatz. Учасник адміністративної команди GeekHub.', '', 'filtered_html'),
('node', 'cours', 0, 45, 45, 'und', 0, 'Курс для тих, хто хоче навчитися створювати сайти різного рівня складності за допомогою популярних CMS Wordpress та Drupal. Якщо ви хочете робити вебсайти як професіонал, цей курс для вас. Особливості різних CMS, використання та написання плагінів та компонентів, інтеграція із соціальними мережами та сторонніми сервісами.', '', 'filtered_html'),
('node', 'cours', 0, 46, 46, 'und', 0, 'AdvancedPHP для тих хто хоче розвивати свої базові навички в PHP. Курс заглиблюється у вивчення ООП, MVC та паттернiв проектування на базі найпопулярнішого php фреймворку Symfony2. Курс буде корисний тим, хто вже спробував себе у написанні простих сайтів/web-додаткiв за допомогою популярних платформ, таких як Joomla, WP ect. AdvancedPHP для тих хто хоче прокачати свої знання та навички для виходу на новий рівень, де вiдсутнi обмеження платформ чи мов програмування.', '', 'filtered_html'),
('node', 'cours', 0, 47, 47, 'und', 0, 'Курс призначений для людей, які хочуть вивчити Javascript зсередини. Курс включає: вивчення мови в деталях, техніки програмування та фреймворків, необхідних, щоб зробити все: від швидкого AJAX додадку, до сучасних великомасштабних додатків.', '', 'filtered_html'),
('node', 'cours', 0, 48, 48, 'und', 0, 'Курс для швидкого старту в розробці програмного забезпечення під популярну мобільну платформу iOS.', '', 'filtered_html'),
('node', 'cours', 0, 49, 49, 'und', 0, 'Android - найпопулярніша операційна система для смартфонів. В цьому курсі ми охопимо найважливіші елементи побудови додатків для цієї платформи. Ознайомимося з основними компонентами UI та UX. Навчимося їх правильно використовувати. Також навчимося працювати в команді та побудуємо корисні додатки.', '', 'filtered_html'),
('node', 'cours', 0, 50, 50, 'und', 0, 'Ruby on Rails (RoR) є популярним та затребуваним фреймворком для написання веб-сервісів на мові програмування Ruby. Використовуючи основні переваги Ruby (динамічна мова для об''єктно-орієнтовного програмування, що відрізняється лаконічністю і інтуітивністю) та еталонної MVC архітектури — RoR дозволяє розробляти якісні веб-сервіси швидкими темпами. Серед веб-проектiв, що написані на Ruby on Rails можна виділити — GitHub, Twitter, Basecamp, Groupon, YP, Shopify та інші.', '', 'filtered_html'),
('node', 'cours', 0, 51, 51, 'und', 0, 'Познайомтесь з одним з найпотужніших фреймворків для швидкої розробки веб-додатків. Гнучкість динамічної мови Groovy (що є надмножиною Java, що на 100% сумiсна Groovy) поєднуються з силою та рiзноманiтнiстю Java бiблiотек та фреймворкiв. Grails - це не тільки набір бібліотек, але й певна філософія розробки, що базуеться на паттернах та найкращих практиках, які стали загальноприйнятими не тільки в середовищі Java, але й в програмуванні вцілому. Спираючись на відносно низький поріг входження, ми спробуемо розглянути повний цикл розробки веб-додатку: побудова інтерфейсу, обробка внутрішньої логіки, зберігання даних.', '', 'filtered_html'),
('node', 'cours', 0, 52, 52, 'und', 0, 'Java -- це основа ентерпрайз технологій. Ви ознайомитесь із мовою, основними классами і пакетами, а також найбільш популярними та потужними фреймворками для розробки веб-аплікейшенів. Курс вимагає підвищеного рівня самостійної роботи, але отримані знання приносять особливу винагороду в роботі.', '', 'filtered_html'),
('node', 'cours', 0, 53, 53, 'und', 0, 'Щоб стати досвідченим менеджером проектів потрібні роки спроб та помилок. Geekhub дає вам можливість набути практичних навичок та уникнути неприємних ситуацій в реальній роботі. Ми навчимо вас розуміти бізнес, відносини із клієнтами, девелоперами та звичайно вивчемо методології ведення проектів.', '', 'filtered_html'),
('node', 'cours', 0, 54, 54, 'und', 0, 'Курс для тих, хто вміє конструктивно критикувати та хотів би з цього навику зробити цікаву інноваційну професію. Ми допоможемо розібратися у непростій науці тестування програмного забезпечення та веб-сайтів, навчимо писати змістовні тест-плани, підкріпивши знання практичними навичками, розберемо базу автоматизованого тестування, зробивши впевнені кроки у її засвоєнні, та спробуємо виховати у студентах тягу до прекрасних продуктів з чудовим юзабіліті та безбажним змістом. ', '', 'filtered_html'),
('node', 'cours', 0, 55, 55, 'und', 0, 'Навички спілкування у діловому середовищі. Якщо ви лідер команди або менеджер проектів, Business English допоможе вам здобути корисні інструменти для ефективних комунікацій як всередині команди так і з клієнтами.', '', 'filtered_html'),
('node', 'cours', 0, 56, 56, 'und', 0, 'Це динамічний та насиченний навчальний курс, який дає змогу отримати базові знання з Веб дизайну та дизайну мобільних додатків. Ви дізнаєтесь як проектувати інтерфейси та робити сайти зручними для відвідувачів. Отримаєте базові знання по композиції, фірмовому стилю, шрифтам та роботі з ком''ютерними програмами для подальшого розвитку у галузі дизайну.', '', 'filtered_html'),
('node', 'cours', 0, 57, 57, 'und', 0, 'Часи, коли ігри створювали фанатики-одинаки давно позаду. Сьогодні шалено зростаюча індустрія геймдеву відкриває двері широкому колу спеціалістів. Курс Game Production познайомить учнів із процессом створення комп’ютерних ігр, особливостями ведення GDD, допоможе розібратися з ігровими механіками, жанрами, тенденціями, термінологією... А ще, надихне спостерігати, помічати, пробувати, вивчати життя, бо, як не дивно, часто саме це визначає якісний геймдев :)', '', 'filtered_html'),
('node', 'header_page', 0, 59, 59, 'und', 0, 'GeekHub - це проект, що надає можливість талановитій молоді отримати практичні знання та навички в сфері розробки програмного забезпечення та IT вцілому. Команда Geekhub — це группа професіоналів в інформаційних технологіях, які готують слухачів курсів до успішної кар’єри в індустрії. Всі члени команди Geekhub працюють у провідних софтверних компаніях, кожного дня оновлюючи свої знання та навички інноваціями в інформаційних технологіях. Саме це дає змогу викладати виключно потрібний матеріал, що знадобиться при роботі в реальних виробничих умовах.\r\n\r\nМи шукаємо мотивованих учнів та студентів, які мріють отримати професію в інформаційних технологіях, для інтенсивного практичного навчання з розробки веб та мобільних додатків. Ми хочемо щоб молоді таланти теж змогли приєднатись до спільноти професіоналів інформаційних технологій і створювали унікальні інтегровані продукти для поліпшення умов праці і життя людей навколо нас.\r\n\r\nМи називаємо Geekhub “Open Source”, тому що саме ця ідеологія керує всією програмою. Все що ми робимо обертається навколо взаємовідносин між людьми. Курси Geekhub не коштують грошей, все що вимагається — це внутрішня мотивація та багато самостійної роботи.\r\n\r\nЯкщо ви зацікавлені у співробітництві з GeekHub, або у вас є ідеї щодо того, як зробити GeekHub краще - будь-ласка, зв''яжіться з нами будь яким зручним для вас шляхом.\r\n', '', 'filtered_html'),
('node', 'header_page', 0, 60, 60, 'und', 0, '<ul>\r\n<li>\r\n<h3>Етапи Реєстрації</h3>\r\n                    <p>Зарахування на курси проходить у 4 етапи:\r\n\r\n                        </p><table>\r\n                            <tbody><tr>\r\n                                <td width="150"><b>до 16 вересня</b></td>\r\n                                <td>Реєстрація на цьому веб-сайті</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td><b>19 вересня</b></td>\r\n                                <td>Вводне зібрання сезону - 19:00, обласна Філармонія</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td><b>27 вересня</b></td>\r\n                                <td>Автоматизовані екзамени</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td><b>з 4 по 10 жовтня</b></td>\r\n                                <td>Співбесіда для тих хто успішно пройшов автоматизовані екзамени</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td><b>13 жовтня</b></td>\r\n                                <td>Початок занять для зарахованих студентів</td>\r\n                            </tr>\r\n                        </tbody></table>\r\n                    <p></p>\r\n                </li>\r\n                <li>\r\n                    <h3>Як підготуватися до вступних екзаменів?</h3>\r\n                    <p>На початку Серпня ми викладемо базові теми які необхідно освоїти для того щоб скласти вступний іспит. Кожен курс буде мати свій набір тем. Така система надає можливість мотивованим людям пройти на курс без попереднього досвіду у цій сфері.</p>\r\n                </li>\r\n                <li>\r\n                    <h3>Скільки коштують курси?</h3>\r\n                    <p>GeekHub -- це спільнота, тому курси безкоштовні. Від потенційних студентів ми вимагаємо високого рівня мотивації та багато часу роботи вдома.</p>\r\n                </li>\r\n                <li>\r\n                    <h3>Чи може GeekHub допомогти мені з працевлаштуванням?</h3>\r\n                    <p>Ми не займаємось працевлаштуванням студентів, що успішно завершили курс. Але як сторонній ефект, Черкаські компанії, знаючи про рівень викладання і сертифікованих студентів часто звертаються до нас за рекомендаціями. За статистикою минулого року, більше 80 процентів сертифікованих студентів були запрошені на роботу.</p>\r\n                </li>\r\n                <li>\r\n                    <h3>Який курс мені краще обрати, якщо я не маю зовсім ніякого досвіду у web?</h3>\r\n                    <p>Frontend + CMS</p>      ', '', 'filtered_html'),
('node', 'header_page', 0, 61, 61, 'und', 0, '<dl>\r\n                <dt class="map">\r\n                    <h3>Заходьте</h3>\r\n                </dt>\r\n                <dd class="map"><div id="map" style="width:382px; height:287px"></div></dd>\r\n                <dt class="follow">\r\n                    <h3>Слідкуйте</h3>\r\n                </dt>\r\n                <dd>\r\n                    <ul>\r\n                        <li class="fb"><a href="http://www.facebook.com/pages/GeekHub/158983477520070">facebook</a></li>\r\n                        <li class="vk"><a href="http://vkontakte.ru/geekhub">vkontakte</a></li>\r\n                        <li class="tw"><a href="http://twitter.com/#!/geek_hub">twitter</a></li>\r\n                    </ul>\r\n                </dd>\r\n                <dt>\r\n                    <h3>Пишіть</h3>\r\n                </dt>\r\n                <dd>\r\n                    <img src="/images/email.png" alt="email"/>\r\n                </dd>\r\n                <dd>Перед тим як писати, ознайомтесь <br>із <a href="faq.html" >сторінкою ПОПУЛЯРНИХ ПИТАНЬ</a></dd>\r\n\r\n            </dl>', '', 'filtered_html');
INSERT INTO `field_data_field_add` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_add_value`, `field_add_format`) VALUES
('node', 'cours', 0, 1, 1, 'und', 0, 'Групові заняття проводитимуться 1 раз в тиждень ввечері, домашнє завдання на кожен урок складатиметься з 3 частин (що вимагатиме від студента мінімум 3 рази на тиждень приділяти увагу курсам вдома).', NULL),
('node', 'cours', 0, 46, 46, 'und', 0, 'Курс Advanced PHP буде складатися з трьох потоків - 2 з яких Symfony2 і 1 - Yii2. Перший місяць навчання буде відведено на загальні для всіх потоків теми, такі як Git, ООП, Composer, TDD. До нового року створимо простий тестовий проект. У другому півріччі будемо розділятися по командах (3-4 чоловіки) щоб виконати фінальний випускний проект.', NULL),
('node', 'cours', 0, 46, 46, 'und', 1, 'Протягом всього навчального року викладачі будуть приділяти максимум уваги тим студентам які зможуть показати свої здібності до навчання та матимуть можливість (і звичайно використовуватимуть її) працювати самостійно не менш ніж 10 год/тиждень. Для цього, раз на місяць, будуть проводитись автоматичні тестування, а також буде братися до уваги активність кожного студента на GitHub.', NULL),
('node', 'cours', 0, 46, 46, 'und', 2, 'Випускники курсу Advanced PHP мають впевнено та доцільно використовувати паттерни проектування, знати та вміти використовувати вибраний фреймворк для побудови масштабованих, тестованих сервісів з відкритим REST API.', NULL),
('node', 'cours', 0, 47, 47, 'und', 0, 'JS - незвичайна мова, тому будемо максимально концентруватись спочатку на ній, потім на инструментах розробки, в кінці - на фрейморках. Протягом курсу будуть проводитись міні-екзамени для перевірки засвоеного. Також будуть практичні уроки. На курс набирається 2 потоки, по два викладача на потік, тому кожному учню буде достатньо уваги.', NULL),
('node', 'cours', 0, 48, 48, 'und', 0, 'Курс розрахований на новачків. ', NULL),
('node', 'cours', 0, 48, 48, 'und', 1, 'Однією з вимог є компютер з встановленою операційною системою OS X, віднесіться до цього відповідально, так як без нього робити на курсі вам нічого.', NULL),
('node', 'cours', 0, 48, 48, 'und', 2, 'Що будемо вчити:\r\nКурс складається з 2х частин. 1ша - ви попарно пишете програму, яку ми вам замовляємо. 2га - ви робите випускну програму, яку самі вигадаєте. Ми дамо вам всі знання, щоб ви могли зробити 1шу. На основі другої ви або отримаєте, або не отримаєте випускний сертифікат.', NULL),
('node', 'cours', 0, 48, 48, 'und', 3, 'Шлангування і поблажки - це не у нас.', NULL),
('node', 'cours', 0, 49, 49, 'und', 0, 'Курс передбачає базові знання Java або здатність швидко здобути ці знання.', NULL),
('node', 'cours', 0, 49, 49, 'und', 1, 'Протягом курсу ви розробите 3 додатка для Android. Третій додаток ви напишете попарно. На основі нього, а також випускної співбесіди буде визначено, отримаєте ви сертифікат чи ні."', NULL),
('node', 'cours', 0, 51, 51, 'und', 0, 'Команда викладачів курсу Groovy & Grails хотіла б привернути увагу людей з досвідом програмування (бажано java-stack), що хочуть вивчити новий та потужний інструмент для побудови свого проекту/стартапу. У той же час, керуючись досвідом минулого року, можна сказати, що низький поріг входження та краса :) Groovy & Grails дозволяють успішно завершити цей курс наполегливим студентам, які ще не мають бойового досвіду у програмуванні. Програма курсу дає можливість поступово освоїти Groovy та Grails. Починаючи з основи синтаксису і shell-скриптів на Groovy, і закінчуючи побудовою модульного та добре налаштованого Grails проекту. Під час курсу ми також розглянемо найкращі практики програмування та шаблони проектування (design patterns).', NULL),
('node', 'cours', 0, 51, 51, 'und', 1, 'Для проходження курсу рекомендовано:\r\n- ознайомитися з основами Java та особливостями роботи JVM\r\n- мати ноутбук, бажано з UNIX системою та вмінням управлятися з нею (Linux Mint, Ubuntu, Mac OS X і т.д.)\r\n- велике бажання та мотивація :)"', NULL),
('node', 'cours', 0, 57, 57, 'und', 0, 'Человек может пройти курс, быть при этом программистом \\ тестером \\ проект-менеджером и т.д. Но этот человек будет иметь представление о том, с чего начинается продукт, зачем его делать, для кого, как анализировать данные, как продвигать его, как управлять продуктом, кого для этого надо поключить и т.д. Без понимания хотябы базовых вещей: целевая аудитория, рынок, конкуренты, спрос, статистических метрик, социальных сетей, как все это работает и какие бывают инструменты, мне кажется вообще разработка невозможна, ни игр, ни приложений, ни сайтов. Если говорить о продукте, а не аутсорсе.', NULL),
('node', 'cours', 0, 57, 57, 'und', 1, 'Человек, закончив курс, в компании может начать с тестера \\ геймдизайнера \\ QA \\ маркетолога \\ саппорта \\ аналитика статистики, неважно. Главное, чтобы у него было понимание того, чем он занимается, как может влиять на процессы и что должно получиться в конечном итоге.', NULL);
