INSERT INTO `field_data_field_questions` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_questions_value`, `field_questions_format`) VALUES
('node', 'cours', 0, 1, 1, 'und', 0, 'Що таке HTML (Wikipedia)', NULL),
('node', 'cours', 0, 1, 1, 'und', 1, ' Що таке CSS (Wikipedia)', NULL),
('node', 'cours', 0, 1, 1, 'und', 2, 'Основи роботи інтернету (сервер, браузер, домен і т.п.). Матеріал брати тут: https://vk.com/videos-30111409 (Урок 1-4)', NULL),
('node', 'cours', 0, 45, 45, 'und', 0, 'Базові знання HTML / CSS (HTML: структура сторінки, теги, посилання, зображення, форми, талиці; CSS: селектори, наслідування, псевдокласи, ідентифікатори і класи, інтеграція css-файлів з HTML)', NULL),
('node', 'cours', 0, 45, 45, 'und', 1, 'Базові знання PHP (синтаксис мови, основи ООП)', NULL),
('node', 'cours', 0, 45, 45, 'und', 2, 'Базові знання JavaScript (синтаксис, основи работи з JQuery)', NULL),
('node', 'cours', 0, 46, 46, 'und', 0, 'Базові знання HTML / CSS (HTML: структура сторiнки, теги, посилання, зображення, форми, таблицi; CSS: селектори, наслiдування, псевдокласи, iдентифiкатори i класи, iнтеграцiя css-файлiв у HTML)', NULL),
